import React from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import { Signup } from "./component/Signup";
import { Login } from "./component/Login";
import { NavbarComp } from "./components/NavbarComp";
import { API } from "./components/API";
import { Myfortfolio } from "./components/Myfortfolio";
import { MutualFunds } from "./components/MutualFunds";
import { isAuthenticated } from "./component/Login";

const PrivateRoute = ({ element, ...rest }) => {
  return isAuthenticated() ? (
    <Route {...rest} element={element} />
  ) : (
    <Navigate to="/" replace />
  );
};

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <PrivateRoute path="/home" element={<NavbarComp />} />
        <PrivateRoute path="/api" element={<API />} />
        <PrivateRoute path="/my-portfolio" element={<Myfortfolio />} />
        <PrivateRoute path="/mutual-funds" element={<MutualFunds />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
